/**
 * @param {string} s
 * @return {number}
 */
 var lengthOfLongestSubstring = function(s) {
    let max = 0
    const start = new Date()
    let visited = new Map();
    let checkSubString = (s) => {
        let mapper = new Map()
        for (let [el, index] of s) {
            if (mapper.has(el)) mapper.set(el, 2)
            else mapper.set(el , 1)
        }
        for (let [key, value] of mapper) {
            if (value === 2) return false
        }
        
        return true
    }
    
    for (let firstPointer = 0, secondPointer = 0; firstPointer <= s.length, secondPointer <= s.length; ++secondPointer  ) {
        if (visited.has(s.slice(firstPointer, secondPointer))) continue
        if (checkSubString(s.slice(firstPointer, secondPointer))) {
            if (max < secondPointer - firstPointer) {
                max = secondPointer - firstPointer
                // firstPointer = secondPointer + 1
                // secondPointer ++ 
            }
        } else {
            ++firstPointer
            secondPointer = firstPointer + 1
            visited.set(s.slice(firstPointer, secondPointer))
        }
    }

    const end = new Date()
    console.log('time', end- start)
    
    return max
};

